import React from 'react'
import './main.css'

export default function Playbar() {
  return (
    <div className='playbar'>
      <div className='icon-container'><i class="fa-regular fa-heart"></i></div>
      <div className='icon-container'><i class="fa-solid fa-music"></i></div>
      <div className='icon-container'><i class="fa-regular fa-shuffle"></i></div>
    </div>
  )
}
